import TableCard from '../../../table/TableCard';
const Writers = ()=>{
    const columns = [
        {
          dataField: "#Order",
          text: "Order Id",

        },
        {
          dataField: "Title",
          text: "Title",

          sort: true
        },
        {
          dataField: "status",
          text: "Status",

        },
        {
          dataField: "created",
          text: "Created On",

        },
        {

            dataField: "deadline",
            text: "Deadline",


        },
        {
            dataField: "Action",
            text: "Action",

          }
      ];

      const products = [
        {
          '#Order': "#7882992",
          price: 100,
          Title: 10,
          status: "japan",
          created:"2020-7-19",
          deadline:"2019-18-10",
          Action:<MoreButton 
              writer={writerDetails}
             accept={AcceptTask}
             Reject={RejectRequest}
             task={TaskDetails}
             taskid={8}
             writerId={5}
          />

        },

      ];

    return <TableCard products={products} columns={columns} title={"Writers"}/>
}

export default Writers;
